import React, { useEffect, useState } from 'react';
import api from '../utils/api';

const Home = () => {
  const [message, setMessage] = useState('');

  useEffect(() => {
    const fetchMessage = async () => {
      try {
        const response = await api.get('/');
        setMessage(response.data.message); // Extract the 'message' from the response object
      } catch (error) {
        console.error("Error fetching data from API:", error);
      }
    };

    fetchMessage();
  }, []);

  return (
    <div>
      <h1>Welcome to Youth Hockey Team Carpool</h1>
      <p>{message}</p> {/* Display the extracted message */}
    </div>
  );
};

export default Home;
